INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Dostawa','Dostawa i zwrot','warunki,dostawa,opoznienie,przesylka,zwrot,paczka','<p style=\"margin-bottom:.28cm;line-height:108%;\"><span style=\"font-size:xx-large;\"><b>Dostawa i zwrot</b></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Opcje dostawy i płatności</b></span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">Odbiór w sklepie – Za darmo! </span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">Kurier DHL - 8,61 zł</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Informacje o zwrotach <br /></b></span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">Aby dokonać zwrotu zakupionych u nas towarów należy skorzystać z prawa do odstąpienia od umowy. Mają państwo na to 14 dni. Aby skorzystać z prawa do odstąpienia od umowy, muszą Państwo poinformować MUZYKANDO S.C. o swojej decyzji w drodze jednoznacznego oświadczenia (poprzez pismo wysłane pocztą, faksem lub pocztą elektroniczną). Mogą Państwo skorzystać z wzoru formularza odstąpienia od umowy, jednak nie jest to obowiązkowe.</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Czas realizacji</b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">Przesyłki realizujemy na bieżąco, </span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\"><span style=\"text-decoration:underline;\">zazwyczaj</span></span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\"> te opłacone do godziny 12 wysyłane są tego samego dnia. W okresie przedświątecznym czas ten może się nieznacznie wydłużyć. Przewidywane terminy dostawy należy liczyć od momentu nadania przesyłki. Ceny zawierają podatek VAT.</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"></p>\n<p></p>','dostawa-i-zwrot'),(2,1,1,'polityka prywatnosci','polityka prywatnosci','prywatnosc','<p style=\"margin-bottom:.28cm;line-height:108%;\"><span style=\"font-size:xx-large;\"><b>Polityka prywatności</b></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>Polityka prywatności <br /> sklepu internetowego www.muzykando.pl</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Niniejsza Polityka prywatności określa zasady gromadzenia, przetwarzania i wykorzystywania danych osobowych pozyskanych od Państwa przez sklep internetowy <br /> MUZYKANDO, prowadzony pod adresem domeny </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>www.muzykando.pl</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Sklep internetowy dokłada wszelkich starań w celu zapewnienia poszanowania Państwa prywatności i ochrony udzielonych informacji osobowych podczas korzystania z Witryny i dokonywania zakupów w ramach sklepu oraz w tym celu podejmuje wszelkie niezbędne działania.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Sklep internetowy, zgodnie z wymogami prawa, zarejestrował zbiór (zbiory) danych osobowych w rejestrze prowadzonym przez Generalnego Inspektora Ochrony Danych Osobowych, pod numerem 134492.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sklep internetowy nie zbiera w sposób automatyczny żadnych danych, z wyjątkiem danych zawartych w plikach s podczas samego korzystania z Witryny.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Pliki s to małe pliki tekstowe wysyłane przez sklep internetowy i przechowywane na Państwa komputerze zawierające pewne informacje związane z korzystaniem przez Państwa z Witryny i Sklepu Internetowego. Pliki s wykorzystywane są przez sklep internetowy w celu obsługi Witryny i zapewnienia możliwości udostępnienia Państwu interesujących informacji oraz podczas procesu zakupowego, np. w celu zapamiętywania dokonanych przez Państwa zakupów.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Pliki s wykorzystywane przez sklep internetowy mogą mieć charakter tymczasowy lub trwały. Tymczasowe pliki s są usuwane z chwilą zamknięcia przeglądarki, natomiast stałe pliki s są przechowywane także po zakończeniu korzystania przez Państwa z Witryny i służą do przechowywania informacji takich jak Państwa hasło czy login, co przyspiesza i ułatwia korzystanie z Witryny. W każdym wypadku mogą Państwo zablokować instalowanie plików s lub usunąć stałe pliki s, wykorzystując stosowne opcje Państwa przeglądarki internetowej. W razie problemów doradzamy skorzystać z pliku pomocy przeglądarki lub skontaktować się z producentem przeglądarki, z której Państwo korzystacie.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Obok plików s sklep internetowy może również gromadzić dane zwyczajowo zbierane przez administratorów systemów internetowych w ramach tzw. logów lub plików dziennika. Informacje zawarte w logach mogą obejmować m.in. Państwa adres IP, rodzaj platformy i przeglądarki internetowej, dostawcę Internetu oraz adres strony, z której weszliście Państwo na Witrynę. Niektóre podstrony w ramach Witryny oraz inne środki komunikacji z Państwem mogą zawierać tzw. „web beacons” (tzw. elektroniczne obrazki). Web beacons pozwalają na otrzymanie informacji takich jak np. adres IP komputera, na który załadowana została strona, na której web beacon został zamieszczony, numer URL strony, czas załadowania strony, rodzaj przeglądarki, jak również informacje zawarte w s, w celu oceny efektywności naszych reklam. Dane te będą archiwizowane i wykorzystywane w celach analizy statystycznej i oceny globalnego ruchu użytkowników Witryny. Dane te nie będą łączone z przekazanymi przez Państwo danymi osobowymi.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b><br /></b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sklep internetowy będzie od Państwa zbierał następujące dane osobowe za pośrednictwem Witryny oraz innych form komunikacji, w przypadku dokonywania zakupów i procesu rejestracji na Witrynie:</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> 1) nazwisko i imię,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">2) adres zameldowania na pobyt stały,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">3) adres do korespondencji, jeżeli jest inny niż adres zameldowania,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">4) adres poczty elektronicznej,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">5) numer telefonu.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Podanie powyższych danych jest dobrowolne lecz konieczne dla dokonania rejestracji i zakupu w ramach Witryny.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Podanie powyższych danych jest dobrowolne i wymaga Państwa zgody i jest konieczne wyłącznie dla realizacji wskazanych powyżej celów. Podkreślamy, że nie muszą Państwo podawać tych danych, jeżeli nie chcą Państwo korzystać z wskazanych powyżej możliwości.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Przysługuje Państwu prawo dostępu do treści swoich danych osobowych oraz prawo ich poprawiania. W celu realizacji tego uprawnienia Prosimy o korzystanie z opcji w ramach swojego konta lub z adresu: sklep-muzyczny.com.pl.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>Marketing Sklepu Internetowego</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">O ile Państwo wyraziliście na to zgodę (zapis do newslettera), podany przez Państwa adres e-mail będzie wykorzystywany w celach marketingowych własnych produktów. Zgoda może być cofnięta w każdym czasie.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Ponadto, podane przez Państwa informacje mogą zostać udostępnione właściwym organom władzy publicznej, jeżeli wymagają tego obowiązujące przepisy prawa.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Instytucją kredytową, przy pomocy której sklep internetowy przeprowadza ocenę kredytową / stosuje procedurę scoringową jest Sygma Bank</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>Środki techniczne i Państwa obowiązki</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sklep internetowy dokłada wszelkich możliwych starań, aby zabezpieczyć Państwa dane i ochronić je przed działaniami osób trzecich. Stosujemy wszelkie niezbędne zabezpieczenia serwerów, połączeń i Witryny w celu ochrony Państwa danych. Wszystkie połączenia związane z wykonywaniem przez Państwa płatności elektronicznych, w przypadku wyboru takiej opcji, będą następować za pośrednictwem bezpiecznego szyfrowanego połączenia.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Podjęte przez nas działania mogą okazać się jednak niewystarczające, jeżeli sami nie zachowają Państwo zasad bezpieczeństwa. W szczególności muszą Państwo zachować w poufności login i hasło do Witryny i nie udostępniać ich osobom trzecim. Proszę pamiętać, że sklep internetowy nie będzie zwracał się do Państwa o ich podanie, z wyjątkiem podania ich w trakcie logowania na Witrynie. W celu uniemożliwienia korzystania z państwa konta osobom nieuprawnionym prosimy się wylogować po zakończeniu korzystania z Witryny.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b><br /></b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Macie Państwo możliwość podglądu i edycji Państwa danych, w każdym czasie, w ramach Witryny, po zalogowaniu się z użyciem adresu email oraz hasła. W sytuacji, gdy zapomnicie Państwo hasła lub wystąpienia innych problemów z logowaniem, prosimy o kontakt pod adresem: sklep@muzykando.pl.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /> Przysługuje Państwo prawo do żądania informacji o treści przechowywanych na Państwa temat danych, jak również prawo do żądania zmiany, zablokowania lub usunięcia danych, a także prawo do sprostowania błędów, uzupełnienia lub uaktualnienia Państwa danych. Macie Państwo również możliwość wniesienia sprzeciwu wobec przetwarzania Państwa danych osobowych w celach marketingowych. Prosimy w tym celu o kontakt pod adresem: sklep@muzykando.pl</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b><br /> Inne strony internetowe</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">W ramach Witryny mogą pojawiać się okresowo linki do innych stron internetowych. Takie strony internetowe działają niezależnie od Witryny i nie są w żaden sposób nadzorowane przez sklep internetowy. Strony te mogą posiadać własne polityki dotyczące prywatności, z którymi zalecamy zapoznać się. Sklep internetowy nie ponosi odpowiedzialności za zasady postępowania z danymi w ramach tych stron.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b><br /> Pytania i zastrzeżenia</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><a></a> <span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Pytania i zastrzeżenia dotyczące niniejszej Polityki prywatności mogą być przez Państwa zadane pod adresem: sklep@muzykando.pl lub Administratorowi Bezpieczeństwa Informacji </span></span></span></p>\n<p style=\"margin-bottom:.28cm;line-height:108%;\"></p>\n<p></p>','polityka-prywatnosci'),(3,1,1,'Regulamin sklepu','Regulamin sklepu','warunki,regulamin','<p style=\"margin-top:.28cm;margin-bottom:.28cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:xx-large;\"><b>Regulamin sklepu internetowego </b></span></span></span></p>\n<p style=\"margin-top:.28cm;margin-bottom:.28cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:xx-large;\"><b>www.muzykando.pl</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> <br /></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>I. Definicje.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 1</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">W niniejszym regulaminie sklepu internetowego www.muzykando.pl, zwanym dalej </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Regulaminem”</b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">, pod poniższymi pojęciami należy rozumieć:</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">a.      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Sprzedawca” </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">– Osoba prowadząca działalność gospodarczą, zarejestrowana w Centralnej Ewidencji i Informacji o Działalności Gospodarczej, </span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">b.      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Sklep” </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">-</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b> </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">sklep internetowy znajdujący się na stronie internetowej <br /> www.muzykando.pl oraz jej podstronach,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">c.       </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Klient”</b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> – (1) osoba fizyczna posiadająca pełną zdolność do czynności prawnych, a w wypadkach przewidzianych przez przepisy powszechnie obowiązujące także osoba fizyczna posiadająca ograniczoną zdolność do czynności prawnych; (2) osoba prawna; albo (3) jednostka organizacyjna nieposiadająca osobowości prawnej, której ustawa przyznaje zdolność prawną; - która zawarła lub zamierza zawrzeć umowę sprzedaży ze Sprzedawcą za pośrednictwem Sklepu,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">d.      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Konto”</b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> – konto Klienta założone przez niego w Sklepie zgodnie z zasadami określonymi w Regulaminie,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">e.      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>„Konsument” </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">–</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b> </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">osoba zdefiniowana w przepisie art. 22</span></span></span><span style=\"color:#333333;\"><sup><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:xx-small;\">1</span></span></sup></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> Kodeksu cywilnego.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>II. Postanowienia ogólne.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 2</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Regulamin określa zasady świadczenia usług drogą elektroniczną przez Sprzedawcę na rzecz Klientów polegających na umożliwieniu im bezpłatnie stworzenia swego Konta, a następnie zawierania przez Internet umów sprzedaży towarów znajdujących się w asortymencie Sklepu za ceny podane na odpowiednich podstronach Sklepu.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 3</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Treści prezentowane na stronach Sklepu, a w szczególności ogłoszenia, reklamy, cenniki i inne informacje, nie są ofertą w rozumieniu przepisów art. 66 i 66</span></span></span><span style=\"color:#333333;\"><sup><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:xx-small;\">1</span></span></sup></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> Kodeksu cywilnego, lecz zaproszeniem do składania ofert.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 4</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Ceny towarów znajdujących się w asortymencie Sklepu są wyrażone w złotych polskich i zawierają podatek VAT. Sprzedawca może dokonywać modyfikacji asortymentu Sklepu, cen towarów, przeprowadzać i odwoływać akcje promocyjne. Zmiany nie mają wpływu na zawarte już z Klientami umowy sprzedaży poszczególnych towarów.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 5</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">1.      Dokonanie zakupu w Sklepie możliwe jest przy użyciu formularza do jednorazowego zamówienia po uprzedniej rejestracji i założeniu Konta. Procedura rejestracji w Sklepie została opisana w postanowieniach części III. Regulaminu.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">2.      Założenie Konta jest równoznaczne z akceptacją Regulaminu, co jest potwierdzane stosownym oświadczeniem składanym przy wypełnianiu formularza rejestracyjnego przez osobę chcącą założyć Konto.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">3.      Korzystanie z formularza  do jednorazowego zamówienia rozpoczyna się z momentem dodania przez Klienta pierwszego towaru do elektronicznego koszyka w Sklepie. Złożenie zamówienia następuje po wykonaniu przez Klienta po wypełnieniu formularza zamówienia– do tego momentu istnieje możliwość samodzielnej modyfikacji wprowadzanych danych (w tym celu należy kierować się wyświetlanymi komunikatami oraz informacjami dostępnymi na stronie Sklepu). W formularzu zamówienia niezbędne jest podanie przez Klienta następujących danych dotyczących Klienta: imię i nazwisko/nazwa firmy, adres (ulica, numer domu/mieszkania, kod pocztowy, miejscowość, kraj), adres poczty elektronicznej, numer telefonu kontaktowego oraz danych dotyczących umowy sprzedaży: towar/y, ilość towaru/ów, miejsce i sposób dostawy towaru/ów, sposób płatności. W wypadku Klientów niebędących konsumentami niezbędne jest także podanie nazwy firmy oraz numeru NIP. Do wysłania formularza i zakończenia procedury zamówienia w Sklepie niezbędna jest akceptacja Regulaminu i polityki prywatności.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 6</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">1.      Do korzystania ze Sklepu nie jest konieczne spełnienie szczególnych warunków technicznych przez komputer lub inne urządzenie Klienta. Wystarczający jest: dostęp do Internetu, posiadanie adresu e-mail oraz standardowy system operacyjny i przeglądarka internetowa. Podczas korzystania ze Sklepu, jak również podczas komunikacji ze Sprzedawcą w celu zawarcia umowy za pośrednictwem Sklepu, Klient nie ponosi innych kosztów za korzystanie ze środka porozumiewania się na odległość poza zwykle stosowanymi.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">2.      Do prawidłowego korzystania z Konta wymagane jest włączenie obsługi plików </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><i>cookies</i></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> w przeglądarce internetowej. Pliki </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><i>cookies</i></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> służą do utrzymania sesji Klienta po zalogowaniu się do Konta oraz do utrzymania procesu składania zamówienia.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>III. Założenie Konta.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 7</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">1.      Osoba chcąca zawrzeć ze Sprzedawcą umowę o założenie Konta powinna się zarejestrować.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">2.      Następnie należy wypełnić powyższy formularz i podać w nim: adres e-mail, hasło do Konta, imię, nazwisko, numer telefonu, adres zamieszkania, a w stosunku do osób prowadzących działalność gospodarczą także NIP, adres miejsca prowadzenia działalności gospodarczej i nazwę firmy. Podany adres e-mail oraz hasło będą po założeniu Konta służyć do logowania się na nie.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">3.      Zabronione jest dodawanie w formularzu treści o charakterze bezprawnym.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">4.      Do wysłania formularza i zakończenia procedury rejestracyjnej w Sklepie niezbędna jest akceptacja Regulaminu i polityki prywatności.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">5.      Kliknięcie przycisku „Zarejestruj mnie” powoduje wysłanie formularza rejestracyjnego i jest równoznaczne z przyjęciem oferty Sprzedawcy. Z tą chwilą między Sprzedawcą, a osobą, która wypełniła formularz rejestracyjny dochodzi do zawarcia umowy o założenie Konta.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">6.      Sprzedawca po zawarciu umowy, zgodnie z postanowieniem ustępu powyższego, wysyła do Klienta, na podany przez niego adres e-mail, wiadomość z potwierdzeniem założenia Konta. Do wiadomości dołączany jest Regulamin oraz polityka prywatności.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">7.      Świadczenie usługi o założenie Konta rozpoczyna się z chwilą zawarcia umowy, o której mowa w postanowieniu ustępu piątego niniejszego paragrafu.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">8.      Klientowi przysługuje prawo odstąpienia od umowy o założenie Konta, bez podania przyczyn, w terminie 14 dni od dnia jej zawarcia, czyli od chwili określonej w postanowieniu ustępu piątego niniejszego paragrafu. Do zachowania powyższego terminu wystarczające jest wysłanie oświadczenia w powyższym terminie do Sprzedawcy.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 8</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Klient powinien starannie przechowywać swoje dane służące do logowania w Sklepie, tak aby żadne osoby nieuprawnione nie uzyskały dostępu do tych danych.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 9</b></span></span></span></p>\n<ol><li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Usługa założenia Konta jest bezpłatna.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Po założeniu Konta Klient ma możliwość podglądu: statusu realizacji zamówień i historii zamówień, a także zawierania umów sprzedaży towarów znajdujących się w Sklepie.</span></span></span></p>\n</li>\n</ol><p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>IV. Złożenie i przyjęcie zamówienia.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 10</b></span></span></span></p>\n<ol><li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sprzedaż towarów odbywa się na podstawie zamówień składanych za pośrednictwem Konta.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Zamówienia można składać poprzez swoje Konto przez 7 dni w tygodniu, 24 godziny na dobę.</span></span></span></p>\n</li>\n</ol><p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 11</b></span></span></span></p>\n<ol><li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">W celu zawarcia umowy sprzedaży ze Sprzedawcą Klient wybiera w Sklepie towary poprzez kliknięcie ikony „Do koszyka” znajdującej się przy wybranym przez Klienta towarze. Towary znajdujące się w koszyku nie są jeszcze zamówione i Klient ma możliwość dodania do koszyka kolejnych towarów, usunięcia znajdujących się tam towarów, a także rezygnacji z dokonania zakupów.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Po dodaniu towarów do koszyka Klient ma możliwość zmiany ilości towarów, jakie chce kupić w Sklepie poprzez zmianę odpowiedniej rubryki w koszyku.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Po dodaniu do koszyka wszystkich towarów, jakie Klient chce zamówić należy wybrać sposób dostawy oraz płatności. Obok dostępnych sposobów dostawy oraz płatności wyświetlone są ich koszty. W rubryce „Wartość Twojego zamówienia” podana jest kwota uwzględniająca ceny towarów dodanych do koszyka oraz cenę wybranego sposobu dostawy i płatności.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Następnie należy kliknąć przycisk „Przejdź Dalej”. Jeżeli Klient posiada już Konto wówczas powinien się na nie zalogować. Jeśli nie posiada takiego Konta, wówczas ma możliwość jego założenia, a następnie kontynuowania złożenia zamówienia.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Następnie należy podać adres dostawy, jeżeli jest inny niż podany przy zakładaniu Konta, a także wskazać, czy Klient chce otrzymać fakturę i kliknąć przycisk „Przejdź Dalej”.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Następnie wyświetlone zostanie potwierdzenie zamówienia. Wyświetlone w potwierdzeniu zamówienia towary wraz z podaniem ich ilości, cen oraz wybrany sposób dostawy i płatności wraz z ich kosztem stanowią skierowane do Klienta przez Sprzedawcę zaproszenie do złożenia oferty zakupu tych towarów.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Na tym etapie składania zamówienia należy również sprawdzić jego prawidłowość oraz potwierdzić,  poprzez kliknięcie przycisku „Potwierdź - zamówienie z obowiązkiem zapłaty”. Do potwierdzenia zamówienia niezbędna jest akceptacja Regulaminu oraz oświadczenie że Klient wie, że złożenie zamówienia pociąga za sobą obowiązek zapłaty. Kliknięcie przycisku „Potwierdź - zamówienie z obowiązkiem zapłaty” powoduje złożenie przez Klienta, Sprzedawcy oferty zakupu towarów znajdujących się w koszyku.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Po złożeniu zamówienia wyświetlona zostanie informacja potwierdzająca otrzymanie zamówienia przez Sprzedawcę, co powoduje związanie Klienta ofertą. Sprzedawca prześle także do Klienta mail z potwierdzeniem złożenia zamówienia przez Klienta oraz podsumowaniem jego treści. Mail ten nie stanowi jeszcze przyjęcia oferty Klienta.</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Następnie Sprzedawca potwierdzi e-mailem, wysłanym na adres mailowy podany przez Klienta w Koncie, przyjęcie oferty złożonej przez Klienta. Z chwilą wprowadzenia powyższej wiadomości e-mail do środka komunikacji elektronicznej Klienta, w taki sposób, że Klient miał możliwość zapoznania się z treścią e-maila, następuje zawarcie umowy sprzedaży między Sprzedawcą a Klientem. Jeżeli Sprzedawca nie będzie miał możliwości przyjęcia oferty Klienta, wówczas prześle do niego e-mail z informacją o odmowie przyjęcia oferty Klienta i przyczynach takiego kroku.</span></span></span></p>\n</li>\n</ol><p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 12</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Koszty związane z realizacją płatności oraz dostawą towarów ponosi Klient, przy czym Sprzedawca może ustalić określony próg wartości zakupów, po którego przekroczeniu przez Klienta koszty dostawy lub płatności pokryje Sprzedawca. Koszty związane z dostawą oraz sposobem płatności są wyświetlane przed złożeniem przez Klienta oferty dotyczącej zakupu towarów znajdujących się w koszyku.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 13</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Do zamówienia dołączony jest dokument sprzedaży, zgodny z przepisami podatkowymi.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 14</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sprzedawca wskazuje, że ma obowiązek dostarczenia rzeczy będących przedmiotem zamówienia bez wad.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>V. Termin i sposób dostawy</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 15</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">1. Sprzedawca zobowiązuje się dostarczyć zamówiony przez Klienta towar w terminie nieprzekraczającym 7 (siedmiu) dni od dnia przyjęcia przez Sprzedawcę zamówienia złożonego przez Klienta; względnie od momentu otrzymania przez Sprzedawcę od Klienta zapłaty za Towar wraz z kosztami przesyłki (jeżeli są należne).     <br /><br /> 2. Dostawa towaru jest realizowana za pośrednictwem Poczty Polskiej lub firmy kurierskiej na adres wskazany przez Klienta w zamówieniu. Sprzedawca nie ponosi odpowiedzialności za niedostarczenie towaru lub opóźnienie w dostawie spowodowane błędnym lub niedokładnym adresem podanym przez Klienta.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>VI. Odstąpienie od umowy.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 16</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">1.      Klientowi przysługuje prawo odstąpienia od umowy sprzedaży zawartej ze Sprzedawcą, bez podania przyczyn, w terminie 14 dni. Termin do odstąpienia od umowy wygasa po upływie 14 dni od dnia, w którym Klient wszedł w posiadanie rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Klienta weszła w posiadanie rzeczy. Jeżeli przedmiotem umowy jest wiele rzeczy, które są dostarczane osobno, termin ten wygasa po upływie 14 dni od dnia, w którym Klient wszedł w posiadanie ostatniej z rzeczy lub w którym osoba trzecia inna niż przewoźnik i wskazana przez Klienta weszła w posiadanie ostatniej z rzeczy.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">2.      Aby skorzystać z prawa odstąpienia od umowy, Klient powinien poinformować Sprzedawcę o swojej decyzji o odstąpieniu od umowy w drodze jednoznacznego oświadczenia (na przykład złożonego na piśmie przesłanym pocztą lub pocztą elektroniczną na adres Sprzedawcy podany w postanowieniu § 1 lit. a Regulaminu).</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">3.      Klient może skorzystać ze wzoru formularza odstąpienia od umowy, zamieszczonego pod adresem </span></span></span><a href=\"http://sklep-muzyczny.com.pl/_cms/view/32/wzor-odstapienia-od-umowy.html\"><span style=\"color:#666666;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><span style=\"text-decoration:underline;\">http://sklep-muzyczny.com.pl/_cms/view/32/wzor-odstapienia-od-umowy.html</span></span></span></span></a><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"> jednak nie jest to obowiązkowe.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">4.      Aby zachować termin do odstąpienia od umowy, wystarczy, aby Klient wysłał informację dotyczącą wykonania przysługującego mu prawa odstąpienia od umowy przed upływem terminu do odstąpienia od umowy.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">5.      W przypadku odstąpienia od umowy Sprzedawca zwraca Klientowi wszystkie otrzymane od niego płatności, w tym koszty dostarczenia rzeczy (z wyjątkiem dodatkowych kosztów wynikających z wybranego przez Klienta sposobu dostarczenia innego niż najtańszy zwykły sposób dostarczenia oferowany przez Sprzedawcę), niezwłocznie, a w każdym przypadku nie później niż 14 dni od dnia otrzymania oświadczenia Klienta o odstąpieniu od umowy. Sprzedawca dokona zwrotu płatności przy użyciu takich samych sposobów płatności, jakie zostały użyte przez Klienta w pierwotnej transakcji, chyba że Klient wyraźnie zgodził się na inne rozwiązanie; w każdym przypadku Klient nie poniesie żadnych opłat w związku ze zwrotem takich płatności,</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">6.      Sprzedawca może wstrzymać się ze zwrotem płatności do chwili otrzymania rzeczy lub do chwili dostarczenia dowodu jej odesłania, w zależności od tego, które zdarzenie nastąpi wcześniej.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">7.      Klient ponosi bezpośrednie koszty zwrotu rzeczy. Sprzedawca wskazuje, że ze względu na charakter zamówionych przez Klienta rzeczy, może się okazać, że nie będą one mogły być odesłane pocztą w zwykłym trybie, co może spowodować zwiększenie kosztu zwrotu rzeczy.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">8.      Klient odpowiada tylko za zmniejszenie wartości rzeczy wynikające z korzystania z niej w sposób inny niż było to konieczne do stwierdzenia charakteru, cech i funkcjonowania rzeczy.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 17</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sprzedawca zwraca uwagę, że zgodnie z przepisem art. 38 ustawy z dnia 30 maja 2014 roku o prawach konsumenta (Dz.U.2014.827) prawo odstąpienia od umowy sprzedaży zawartej ze Sprzedawcą nie przysługuje Klientowi w odniesieniu do umowy:</span></span></span></p>\n<ol><li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">w której przedmiotem świadczenia jest rzecz nieprefabrykowana, wyprodukowana według specyfikacji Klienta lub służąca zaspokojeniu jego zindywidualizowanych potrzeb;</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">w której przedmiotem świadczenia są rzeczy, które po dostarczeniu, ze względu na swój charakter, zostają nierozłącznie połączone z innymi rzeczami;</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">w której Klient wyraźnie żądał, aby Sprzedawca do niego przyjechał w celu dokonania pilnej naprawy lub konserwacji; jeżeli Sprzedawca świadczy dodatkowo inne usługi niż te, których wykonania Klient żądał, lub dostarcza rzeczy inne niż części zamienne niezbędne do wykonania naprawy lub konserwacji, prawo odstąpienia od umowy przysługuje Klientowi w odniesieniu do dodatkowych usług lub rzeczy;</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu;</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">o dostarczanie dzienników, periodyków lub czasopism, z wyjątkiem umowy o prenumeratę;</span></span></span></p>\n</li>\n<li>\n<p style=\"margin-top:.49cm;margin-bottom:.49cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">o dostarczanie treści cyfrowych, które nie są zapisane na nośniku materialnym, jeżeli spełnianie świadczenia rozpoczęło się za wyraźną zgodą Klienta przed upływem terminu do odstąpienia od umowy i po poinformowaniu go przez przedsiębiorcę o utracie prawa odstąpienia od umowy.</span></span></span></p>\n</li>\n</ol><p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:large;\"><b>VII. Odpowiedzialność z tytułu rękojmi (reklamacje).</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 18</b></span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">1.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Sprzedawca jest zobowiązany sprzedać i dostarczyć Klientowi towar bez wad fizycznych i prawnych.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">2.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Klientowi przysługuje prawo do złożenia reklamacji w przypadku gdy towar ma wadę fizyczną lub prawną (rękojmia).</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">3.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Wada fizyczna polega na niezgodności towaru z umową sprzedaży. W szczególności towar jest niezgodny z umową sprzedaży jeżeli: <br /></span></span></span><br /></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\">   </span><span style=\"color:#333333;\">     </span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">3.1. towar nie ma właściwości, które towar tego rodzaju powinien mieć ze względu na cel w umowie sprzedaży oznaczony albo wynikający z okoliczności lub przeznaczenia; <br /> 3.2. towar nie ma właściwości, o których istnieniu Sprzedawca zapewniał; <br /> 3.3. towar został Klientowi wydany w stanie niezupełnym.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">4.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Sprzedawca ponosi odpowiedzialność z tytułu rękojmi za wady fizyczne, które istniały w chwili wydania towaru Klientowi lub wynikły z przyczyny tkwiącej w towarze sprzedanym w chwili wydania towary Klientowi.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">5.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\"> Towar sprzedany ma wadę prawną, jeżeli stanowi własność osoby trzeciej albo jest obciążony prawem osoby trzeciej, a także jeżeli ograniczenie w korzystaniu lub rozporządzaniu rzeczą wynika z decyzji lub orzeczenia właściwego organu.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">6.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Reklamacje można składać pisemnie na adres Sprzedawcy podany w postanowieniu § 1 lit. a, mailowo na następujący adres e-mail:sklep@muzykando.pl, osobiście do protokołu w siedzibie Sprzedawcy podanej w postanowieniu § 1 lit. a, bądź w innej formie.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">7.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">W reklamacji należy podać: numer zamówienia (lub inne dane pozwalające je zidentyfikować), dane kontaktowe Klienta umożliwiające udzielenie odpowiedzi na złożoną reklamację oraz opis zdarzenia będącego podstawą reklamacji.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">8.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Jeżeli towar sprzedany ma wadę, Klient ma prawo:</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">a.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">żądać wymiany towaru wadliwego na wolny od wad albo żądać usunięcia wady;          </span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">albo</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">b.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">      </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\"> złożyć oświadczenie o proporcjonalnym obniżeniu ceny albo odstąpieniu od umowy, przy czym w takim przypadku Sprzedawca może niezwłocznie i bez nadmiernych niedogodności dla Klienta wymienić towar wadliwy na wolny od wad albo wadę usunąć; jednakże jeżeli towar był już wymieniony lub naprawiany przez Sprzedawcę albo Sprzedawca nie uczynił zadość obowiązkowi wymiany towaru na wolny od wad lub usunięcia wady, powyższe ograniczenie nie stosuje się i Klient może złożyć stosowne oświadczenie o proporcjonalnym obniżeniu ceny albo odstąpieniu od umowy;</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">9.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Klient nie może odstąpić od umowy sprzedaży, jeżeli wada jest nieistotna.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">10.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Klient zamiast zaproponowanego przez Sprzedawcę usunięcia wady może żądać wymiany towaru na wolny od wad albo zamiast wymiany towaru żądać usunięcia wady, chyba że doprowadzenie towaru do zgodności z umową sprzedaży w sposób wybrany przez Klienta jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">11.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Sprzedawca może odmówić wymiany towaru wadliwego na wolny od wad albo usunięcia wady, jeżeli doprowadzenie do zgodności z umową sprzedaży towaru wadliwego w sposób wybrany przez Klienta jest niemożliwe lub w porównaniu z drugim możliwym sposobem wymagałoby nadmiernych kosztów.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">12.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Reklamacje rozpatrywane są najpóźniej w terminie 14 (czternastu) dni od daty otrzymania przez Sprzedawcę reklamacji, o czym Klient zostanie powiadomiony za pośrednictwem poczty elektronicznej na adres e-mailowy podany przez Klienta albo przesyłką pocztową na adres wskazany przez Klienta.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">13.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\"> Klient ma prawo do złożenia reklamacji w ciągu 2 (dwóch) lat od dnia wydania towaru Klientowi.</span></span></span></p>\n<p style=\"margin-left:2.16cm;text-indent:-.64cm;margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">14.</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:\'Times New Roman\', serif;\"><span style=\"font-size:xx-small;\">  </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\"> Skorzystanie przez Klienta z uprawnień opisanych w niniejszym punkcie nie ogranicza możliwości skorzystania z uprawnień gwarancji.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:medium;\"><br /></span></span></span><br /></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>VIII. Czas trwania umowy o założenie Konta.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 19</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Umowa z Klientem o założenie Konta zostaje zawarta na czas nieokreślony.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 20</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Klient może w każdym czasie wypowiedzieć umowę o założenie Konta poprzez wysłanie wypowiedzenia na adres Sprzedawcy podany w § 1 lit a, e-mailem na adres sklep@muzykando.com.pl lub w innej formie. Umowa zostanie rozwiązana z chwilą otrzymania przez Sprzedawcę wypowiedzenia.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>IX. Postanowienia końcowe.</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 21</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">W trakcie korzystania ze Sklepu oraz korespondencji z nim zakazane jest podawanie treści o charakterze bezprawnym.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"> </span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 22</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><br /></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"justify\"><span style=\"color:#333333;\"><span style=\"font-family:Calibri, serif;\"><span style=\"font-size:small;\">Sprzedawca oświadcza, iż publiczny charakter sieci internet i korzystanie z usług świadczonych drogą elektroniczną wiązać może się z zagrożeniem pozyskania i modyfikowania danych Klienta przez osoby nieuprawnione, dlatego Klient powinien stosować właściwe środki techniczne, które zminimalizują wskazane wyżej zagrożenia. W szczególności stosować programy antywirusowe i chroniące tożsamość korzystających z sieci Internet. Sprzedawca nigdy nie zwraca się do Klienta z prośbą o udostępnienie mu w jakiejkolwiek formie Hasła. Sprzedawca dokłada należytej staranności w celu zabezpieczenia funkcjonowania Sklepu.</span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\" align=\"center\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><b>§ 23</b></span></span></span></p>\n<p style=\"margin-top:.42cm;margin-bottom:.42cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\">Sprzedawca wskazuje, że w przypadku zaistnienia sporu pomiędzy Konsumentem a Sprzedawcą, istnieje możliwość pozasądowych sposobów dochodzenia roszczeń, takich jak np. mediacja, sąd polubowny, opisanych w zakładce: </span></span></span><a href=\"http://pasjamusic.redcart.pl/_cms/view/33/pozasadowe-dochodzenie-roszczen.html\"><span style=\"color:#666666;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><span style=\"text-decoration:underline;\">\"POZASĄDOWE DOCHODZENIE ROSZCZEŃ\".</span></span></span></span></a></p>\n<p></p>','regulamin'),(4,1,1,'O nas','O nas','o nas,informacje','<p style=\"margin-bottom:.28cm;line-height:108%;\"><span style=\"font-size:xx-large;\"><b>O nas</b></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Serdecznie zapraszamy <br /></b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">do jednego z największych i najlepiej zaopatrzonych internetowych sklepów muzycznych. </span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Oferujemy </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">szeroki asortyment w zakresie instrumentów i akcesoriów muzycznych, sprzętu nagłośnieniowego oraz wydawnictw muzycznych. W naszej szerokiej ofercie znajdziecie Państwo:</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">instrumenty klasyczne, dęte, perkusyjne, klawiszowe i smyczkowe. </span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">Sprzęt nagłośnieniowy najlepszych marek. Mikrofony, kolumny, piece, miksery, oświetlenie dyskotekowe. A także wydawnictwa, nuty, książki i ćwiczenia oraz partytury, również muzykę poważną i klasyczną</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Sklep Muzyczny Muzykando</b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">ul. Karkonoska 17</span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">80-180 Gdańsk</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">NIP: 160-281-96-28</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Kontakt </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">tel. 609 867 049</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Konto bankowe </b></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Helvetica, serif;\"><span style=\"font-size:small;\"><br /></span></span></span><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\">mbank: 08114020000000312242030792</span></span></span></p>\n<p style=\"margin-bottom:.28cm;line-height:108%;\"><br /></p>\n<p></p>','o-nas'),(5,1,1,'Metody płatności','metody płatności',' paypal,paypal,visa,mastercard,metody platnosci,przelew,czek','<p style=\"margin-bottom:.28cm;line-height:108%;\"><span style=\"font-size:xx-large;\"><b>Metody płatności</b></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Płatność przelewem bankowym – </b></span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">płacisz po złożeniu zamówienia. Numer konta prześlemy Ci w mailu, potwierdzającym przyjęcie zamówienia. </span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">Przesyłka zostanie wysłania dopiero, gdy pieniądze wpłyną na nasze konto (czas zaksięgowania środków to średnio 24 godzin). O wysłaniu paczki poinformujemy Cię osobnym mailem. </span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-family:Tahoma, serif;\"><span style=\"font-size:medium;\"><b>Płatność za pobraniem – </b></span></span></span><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\">pobranie gotówki przy odbiorze przesyłki</span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#303030;\"><span style=\"font-family:Arial, serif;\"><span style=\"font-size:medium;\"></span></span></span></p>\n<p style=\"margin-bottom:0cm;line-height:100%;\"><span style=\"color:#333333;\"><span style=\"font-fami